import React from 'react';

const CardWidget = ({ cartTotal }) => {
  return (
    <div style={{ position: 'relative', display: 'inline-block' }}>
      <img src="/path/to/cart-icon.png" alt="Cart" />
      <span style={{
        position: 'absolute',
        top: '-10px',
        right: '-10px',
        background: 'red',
        color: 'white',
        borderRadius: '50%',
        padding: '5px 10px',
        fontSize: '12px'
      }}>
        {cartTotal}
      </span>
    </div>
  );
};

export default CardWidget;
